import './App.css';
import Header from './components/header/Header';
import {
  BrowserRouter as Router, Routes, Route
} from "react-router-dom";
import Pages from './pages/Pages';


function App() {
  return (
    <>
    <Router>

      <Routes>
      <Header />
          <Route path="/" exact>
            <Pages />
          </Route>
      </Routes>
      </Router>
    </>
  );
}

export default App;
